bool ScanDump()
{
	bool Return = false;

	HANDLE hProc = CreateToolhelp32Snapshot(TH32CS_SNAPPROCESS,0);

	if (hProc != INVALID_HANDLE_VALUE)
	{
		PROCESSENTRY32 mP32;

		mP32.dwSize = sizeof(mP32);

		Process32First(hProc,&mP32);

		do 
		{
			HANDLE hProcess = OpenProcess( PROCESS_ALL_ACCESS,false,mP32.th32ProcessID);

			if (hProcess != NULL)
			{
				for (int i = 0; i < (sizeof(DB) / sizeof(Database)); i++)
				{
					unsigned char Bytes[32];
					unsigned long BytesRead;

					if (ReadProcessMemory(hProcess,(LPCVOID)DB[i].Offset,(LPVOID)Bytes,32,&BytesRead))
					{
						if (BytesRead == 32)
						{							
							if (!memcmp(Bytes,DB[i].Bytes,32))
							{
								Return = true;
								TerminateProcess(hProcess,NULL);
							}
						}
					}
				}		

				CloseHandle(hProcess);
			}
		} 

		while (Process32Next(hProc,&mP32));
	}

	CloseHandle(hProc);

	return Return;
}

void HiddenScan()
{
	DWORD prID = 0;
	HWND hWnd = FindWindow(0, 0);

	while (hWnd > 0)
	{
		if (GetParent(hWnd) == 0)
		{
			GetWindowThreadProcessId(hWnd, &prID);

			if (OpenProcess(PROCESS_TERMINATE, false, prID) == NULL)
			{
				if (IsWindow(hWnd))
				{
					SendMessageA(hWnd,WM_CLOSE,0,0);
				    SendMessageA(hWnd,WM_QUIT,0,0);
				    SendMessageA(hWnd,WM_DESTROY,0,0);
				}
			}
		}

		hWnd = GetWindow(hWnd, GW_HWNDNEXT);
	}
}

